import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <div className="header">
        <h1>pilih halaman</h1>
        <table>
          <tr>halaman csv</tr>
          <tr>halaman xml</tr>
          <tr>halaman json</tr>
        </table>

      </div>
    </div>
  );
}

export default App;
